import React from 'react';
import ContactMeForm from '../contactMeForm/ContactMeForm';

const Contact = ({id}) => {
    return(
            <div className = 'vh-100 w-75 center mt5 flex' id = {id}>
            <div className = 'justify-left'>
                <h1 className = 'tc pt5 fw5 underline'>Contact Me</h1>
                <div className = 'pt3'>
                    <ContactMeForm />
                </div>
            </div><br/>
            <footer className = 'pt2'>Made By Colton Williams</footer>
             <div className = 'bb mt2'>
             </div>
            </div>
 );
}

export default Contact;
